import Footer from "../components/Footer";
import Header from "../components/Header";
import React from "react";
import { Canvas } from '@react-three/fiber'
import { Html, Box, OrbitControls, Text, TorusKnot} from '@react-three/drei'

function HomePage(){
    function Jumbo() {
        const ref = useRef()
        useFrame(({ clock }) => (ref.current.rotation.x = ref.current.rotation.y = ref.current.rotation.z = Math.sin(clock.getElapsedTime()) * 0.3))
        return (
          <group ref={ref}>
            <Text hAlign="right" position={[-12, 6.5, 0]} children="REACT" />
            <Text hAlign="right" position={[-12, 0, 0]} children="THREE" />
            <Text hAlign="right" position={[-12, -6.5, 0]} children="FIBER" />
          </group>
        )
      }
      
    return(
        <Canvas>
            <ambientLight intensity={2} />
             <pointLight position={[40, 40, 40]} />
            <OrbitControls />
            <Jumbo/>
        </Canvas>
    );
    
}

export default HomePage;
